import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect
} from "react-router-dom";
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
		<Router>
		  <div>
			<ul style={styles.nav}>
			  <li style={styles.li}>
				<Link to="/">Events</Link>
			  </li>
			  <li style={styles.li}>
				<Link to="/articles">Articles</Link>
			  </li>
			  <li style={styles.li}>
				<Link to="/authors">Authors</Link>
			  </li>
			  <li style={styles.li}>
				<Link to="/reviewers">Reviewers</Link>
			  </li>
			  <li style={styles.li}>
				<Link to="/login">Login</Link>
			  </li>
			</ul>

			<hr />

			<Route exact path="/" component={Events} />
			<Route path="/articles" component={Articles} />
			<Route path="/authors" component={Authors} />
			<Route path="/reviewers" component={Reviewers} />
			<Route path="/login" component={Login} />
		  </div>
		</Router>
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            React Hello World
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

function Events() {
  return (
    <div>
      <h2>Event</h2>
    </div>
  );
}

function Articles() {
  return (
    <div>
      <h2>Articles</h2>
    </div>
  );
}

function Authors() {
  return (
    <div>
      <h2>Authors</h2>
    </div>
  );
}

function Reviewers() {
  return (
    <div>
      <h2>Reviewers</h2>
    </div>
  );
}

function Login() {
  return (
    <div>
      <h2>Login</h2>
    </div>
  );
}

const styles = {};

styles.nav = {
  padding: 0,
  margin: 0,
  marginLeft: "150px",
  marginTop: "20px",
  height: "50px",
  width: "100px",
  display: "flex"
};

styles.li = {
  marginRight: "150px",
  listStyleType: "none"
};

export default App;
